import styles from  './Card.module.css';

function Card({front, back}) {
  return (
    <div className={styles.Card}>
      <div className={styles.cardWrapper}>
        <div className={styles.face}>
          {front}
          <h1>front</h1>
        </div>
        <div className={`${styles.face} ${styles.back}`}>
          {back}
          <h2>back</h2>
        </div>
      </div>
    </div>
  );
}

export default Card;
